import React from 'react';

import './List.css'
import ListItem from '../ListItem/ListItem';

const List = ({items}) => {
    return (
        <div className="list">
            {/* <h5>{this.props.listName} ></h5> */}
            <div className="listItems">
                { items && items.map(item => {
                    return(
                        <ListItem item={item} key={item.id}/>
                    )
                })}
            </div>
        </div>
    )
}

export default List;
